Шестакова Ольга - руководитель танцевального коллектива "Тюрбан", профессиональный педагог, с 15-летним опытом преподавания танцев и выступлений, многократно участвовавшая в мастер-классах и семинарах отечественных и зарубежных преподавателей( танец живота - Пенкина Юлия, Белопольская Ирина, Черникина Ирина, Федяева Татьяна(Нур), Степанова Ольга(Нур), Саулина Софья, Оганян Марина, Калашникова Анастасия, Черновская Анастасия, Ефремова Олеся, Айда Хассан, Ильтимирова Ольга, Wael Mansur, Mahdi Emara, Yasser Al Swery и др.;
трайбл - Дворецкая Светлана, Демина Екатерина, Тиана(Татьяна Фролкина), Дивон, Martina Crowe Hewett, Olivia Kissel, Illan Riviere, Steven Eggers, Samantha Emanuel, Rachel Brice, Fat Chance Belly Dance(Sandy & Wendy), Tamarind Tribal (Jennifer & Kate), Manhattan Tribal (Mimi Fontana & Debbie), Unmata и др.;
гавайский танец (хула) - Анастасия Каиви.)
